@iqthon.on(admin_cmd(pattern="ŸÖŸÑÿµŸÇ ŸÖÿ™ÿ≠ÿ±ŸÉ(?: |$)(.*)"))
async def honkasays(event):
    await event.edit("**ÿ¨ÿßÿ±Ÿä ÿßŸÑÿ™ÿ≠ŸàŸäŸÑ **")
    text = event.pattern_match.group(1)
    if not text:
        return await event.edit("**ŸÇŸÖ ÿ®ŸÉÿ™ÿßÿ®Ÿá ÿßŸÑŸÉŸÑŸÖŸá ÿ®ÿ¨ÿßŸÜÿ® ÿßŸÑÿßŸÖÿ±**")
    try:
        if not text.endswith("."):
            text = text + "."
        if len(text) <= 9:
            results = await bot.inline_query("honka_says_bot", text)
            await results[2].click(
                event.chat_id,
                silent=True,
                hide_via=True,
            )
        elif len(text) >= 14:
            results = await bot.inline_query("honka_says_bot", text)
            await results[0].click(
                event.chat_id,
                silent=True,
                hide_via=True,
            )
        else:
            results = await bot.inline_query("honka_says_bot", text)
            await results[1].click(
                event.chat_id,
                silent=True,
                hide_via=True,
            )
        await event.delete()
    except ChatSendInlineForbiddenError:
        await event.edit("**ÿ¨ÿßÿ±Ÿä ÿßŸÑÿ™ÿ≠ŸàŸäŸÑ **")
    except ChatSendStickersForbiddenError:
        await event.edit("**ÿ¨ÿßÿ±Ÿä ÿßŸÑÿ™ÿ≠ŸàŸäŸÑ **")
